import axios from 'axios';
import React, { Component } from 'react'; 
import moment from 'moment'
class App extends Component {
    constructor(props){
        super(props)
        this.state = {
            searchedCityDetails: [],
            fiveDaysDataList: []
        }
    }

    getFiveDaysWeatherReport = ()=>{
        console.log('getFiveDaysWeatherReport')
        axios
        .get('https://api.openweathermap.org/data/2.5/forecast', {
                params: {
                    appid: 'c85926f783685bd4203a4255e5b93c4f',
                    lat: 51.51,
                    lon:-0.13,
                }
            })
          .then(res => {
            const resData = res.data.list;
          //  console.log(resData.list)
            this.setState({ fiveDaysDataList:resData });
          })

    }
    componentDidMount() {
        axios
        .get('https://api.openweathermap.org/data/2.5/weather', {
                params: {
                    appid: 'c85926f783685bd4203a4255e5b93c4f',
                    q: 'London',
                }
            })
          .then(res => {
            const resData = res.data;
            // console.log(resData)
           this.setState({searchedCityDetails:resData},()=> this.getFiveDaysWeatherReport());
          })
      }
    render() {
        const {fiveDaysDataList} = this.state
        return (


            <div className="container">
                <div class="active-pink-3 active-pink-4 mt-4">
                    <input class="form-control" type="text" placeholder="Enter City Name " aria-label="Search" />
                </div>
                <div class="row pt-5">
                    <div className="col">
                        <div class="card">
                            <div class="card-body">
                                <h5 class="card-title text-center">wed</h5>
                                <img
                                    src={`data:image/png;base64,`}
                                    className="img-fluid d-block"
                                    alt="logo"
                                />
                            </div>
                        </div>
                    </div>
                    <div className="col">
                        <div class="card">

                            <div class="card-body">
                                <h5 class="card-title text-center">thu</h5>
                                <img
                                    src={`https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSBRyLjBphD6ogcparhuK8dw34198By8tce6g&usqp=CAU`}
                                    className="img-fluid d-block"
                                    alt="logo"
                                />
                            </div>
                        </div>
                    </div>
                    <div className="col">
                        <div class="card">

                            <div class="card-body">
                                <h5 class="card-title text-center">fri</h5>
                                <img
                                    src={`https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRS70L-iHFmYWpM9-7w0hmw8zARwwe_CHPO1w&usqp=CAU`}
                                    className="img-fluid d-block"
                                    alt="logo"
                                />
                            </div>
                        </div>
                    </div>
                    <div className="col">
                        <div class="card">

                            <div class="card-body">
                                <h5 class="card-title text-center">sat</h5>
                                <img
                                    src={`data:image/png;base64,`}
                                    className="img-fluid d-block"
                                    alt="logo"
                                />
                            </div>
                        </div>
                    </div>
                    <div className="col">
                        <div class="card">

                            <div class="card-body">
                                <h5 class="card-title text-center">sun</h5>
                                <img
                                    src={`https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRIlsKtgATXzZBDZJ-MEXO-1PM97ahCRhkmzw&usqp=CAU`}
                                    className="img-fluid d-block"
                                    alt="logo"
                                />
                            </div>
                        </div>
                    </div>
                </div>
                <p>Hi</p>
                    { fiveDaysDataList && fiveDaysDataList.length > 0 &&

                        fiveDaysDataList.map((data,index) =>{
                        console.log(data,moment(data.dt_txt).format("dddd"))
                        return(
                            <p>{moment(data.dt_txt).format("dddd")}</p>
                        )
                    })}
            </div>
        )
    }

}

export default App;
